import React from "react";
//import styles from "../cardHolder/cardHolder.module.css";

import styles from "../header/header.module.css";
import NameForm from "../test/NameForm"

export default (props) => (
  <div className={styles.center}>
    <div className={styles.intro}>

      <p>My name is eveline, and I have a a cat blog. I think cats are cool, but I love my dog Franklin a lot!!!!</p> 
      <p>I also really like</p>

      <ul>
        <li>cats</li>
        <li>bacon</li>
        <li>space</li>
      </ul>      

    </div>
  <NameForm />
  </div>
);
